INSERT INTO `supawdb`.`review` (`reviewID`, `userID`, `productID`, `reviewText`, `rating`) VALUES ('801', '401', '101', "Kramer's Kibbles captures the essence of Seinfeld's comedic charm, offering dogs a nutritious and tasty treat to keep them satisfied.", '5');
INSERT INTO `supawdb`.`review` (`reviewID`, `userID`, `productID`, `reviewText`, `rating`) VALUES ('802', '402', '101', "With Kramer's Kibbles, your furry friend can enjoy a delicious snack without resorting to neighborly antics, delivering both flavor and essential nutrients.", '4');
INSERT INTO `supawdb`.`review` (`reviewID`, `userID`, `productID`, `reviewText`, `rating`) VALUES ('803', '403', '101', "Seinfeld fans and pet owners alike will appreciate the humor and quality behind Kramer's Kibbles, ensuring dogs stay happy and healthy while avoiding any 'next-door' adventures.", '3');
